## Proposed changes

### New scanner design
`ScannerSchedule` cancels the scheduling queue `_pending_queues`, just initialize three common thread pools in the main function.
```
class ScannerScheduler {
    // _local_scan_thread_pool is for local scan task(typically, olap scanner)
    // _remote_scan_thread_pool is for remote scan task(cold data on s3, hdfs, etc.)
    // _limited_scan_thread_pool is a special pool for queries with resource limit
    std::unique_ptr<PriorityThreadPool> _local_scan_thread_pool;
    std::unique_ptr<PriorityThreadPool> _remote_scan_thread_pool;
    std::unique_ptr<ThreadPool> _limited_scan_thread_pool;
    
    // submit scan task
    Status submit(std::shared_ptr<ScannerContext> ctx, std::shared_ptr<RunningScanner> scanner) {
        // submit to thread pool, run as daemon.
        // append to block queues after reading the next block
        ctx->append_block_to_queue(scanner);
    }
}
```
`RunningScanner` only caches one block in current loop
```
class RunningScanner {
    std::weak_ptr<ScannerDelegate> _scanner;
    vectorized::BlockUPtr current_block;
    bool eos;
}
```
`ScannerContext` submit the running scanner when initializing, or consuming the `current_block`.
```
Status init() {
  for (int i = 0; i < _max_thread_num; ++i) {
      std::weak_ptr<ScannerDelegate> next_scanner;
      if (_scanners.try_dequeue(next_scanner)) {
          vectorized::BlockUPtr block = get_free_block(_batch_size);
          ScannerScheduler::submit(
                  std::make_shared<RunningScanner>(next_scanner, std::move(block)));
      }
  }
}

Status get_block_from_queue(RuntimeState* state, vectorized::BlockUPtr* block, bool* eos) {
    std::shared_ptr<RunningScanner> scanner;
    bool ok = _blocks_queue->blocking_get(&scanner);
    if (scanner->eos) {
        std::weak_ptr<ScannerDelegate> next_scanner;
        if (get_next_scanner(&next_scanner)) {
            ScannerScheduler::submit(this, std::make_shared<RunningScanner>(next_scanner));
        } else {
            ...
        }
    } else {
        ScannerScheduler::submit(this, scanner);
    }
}
```

### Increase concurrency adaptively
Four criteria to determine whether to increase the parallelism of the scanners
1. `ScanNode` has ran for at least `SCALE_UP_DURATION` ms after the last scaling up
2. Half(control by `WAIT_BLOCK_DURATION_RATIO`) of the duration is waiting to get blocks
3. `_free_blocks_memory_usage` < `_max_bytes_in_queue`, `ScanNode` remains enough memory to scale up
4. At most scale up `MAX_SCALE_UP_RATIO` times to `_max_thread_num`


